void right();


//run time==dtime
int dtime=1000; //used for turning
//sped control
unsigned int sped= 96;

void setup() {
 Serial.begin(9600);
 pinMode(m1FW, OUTPUT);
 pinMode(m1RV, OUTPUT);
 pinMode(m2FW, OUTPUT);
 pinMode(m2RV, OUTPUT);
}
// lets make a fire!
void loop() {

  char inByte = ' ';
      if(Serial.available()){ // only send data back if data has been sent
          char inByte = Serial.read(); // read the incoming data
          Serial.println(inByte); 
  switch (inByte) {
    //wasd ws=y ad=x
    case 'w':
      halt();
      fw(); 
      break;
      case 'a':
      halt();
      left();   
      break;    
      case 's':
      halt();
      rv();
      break;    
      case 'd':
      halt();
      right();  
      break;
      case 'b':
      halt();  
      break;
    default:
      halt();  
      break;
        }
    }
}

