  halt();
  analogWrite(m1FW, sped);
  analogWrite(m2RV, sped);   
  delay(dtime);               // wait for a second
  halt();
  }

void right(){
  halt();
  analogWrite(m1RV,sped);
  analogWrite(m2FW,sped);   
  delay(dtime);               // wait for a second
  halt();
  }

void rv(){
  analogWrite(m1RV,sped);
  analogWrite(m2RV,sped);   
  }

void fw(){
  analogWrite(m1FW,sped);
  analogWrite(m2FW,sped);   
  }

void halt(){
  //stop all that sht
   analogWrite(m1FW, 0); 
   analogWrite(m1RV, 0); 
   analogWrite(m2FW, 0); 
   analogWrite(m2RV, 0); 

  }

